('system_setting_data', 'O:8:\"stdClass\":12:{s:11:\"system_name\";s:5:\"Admin\";s:12:\"system_title\";s:15:\"Admin Dashboard\";s:11:\"system_icon\";s:8:\"icon.png\";s:11:\"system_logo\";s:25:\"Admin_logo_1715335881.png\";s:14:\"system_version\";s:5:\"1.0.0\";s:17:\"system_copy_right\";s:61:\"    Copyright © 2014-2021 AdminLTE.io. All rights reserved. \";s:15:\"system_bg_image\";s:12:\"login_bg.jpg\";s:13:\"system_slogan\";s:5:\"Admin\";s:12:\"system_email\";s:25:\"minulhasanrokan@gmail.com\";s:13:\"system_mobile\";s:14:\"+8801627197089\";s:14:\"system_address\";s:66:\"215/A, Outer Circular Road, Baro Moghbazar, Dhaka 1217, Bangladesh\";s:14:\"system_details\";s:928:\"<div align=\"right\">Experienced Programmer and Solutions Architect specializing in PHP (Laravel & CodeIgniter) with a strong foundation in database management (Oracle, MySQL, SQL Server). I bring over 3 years of expertise in developing ERP and banking solutions that streamline operations, enhance data security, and drive business efficiency.\r\n\r\nMy passion lies in crafting custom software solutions that empower businesses to excel in the ever-evolving world of finance and enterprise resource planning. I take pride in my ability to create scalable, high-performance systems that meet the unique demands of the banking sector and ERP platforms.\r\n\r\nLet\'s connect to discuss potential collaborations, industry insights, or explore ways to leverage technology to achieve your business goals. I\'m always eager to share knowledge and contribute to innovative projects that shape the future of finance and business operations.</div>\";}', 2030979963),
